import React, {Fragment} from 'react';

const DescriptionWithLink = (props) =>{
    return (
        <Fragment>
            <p>{props.text}</p>
            <a href={props.url}>{props.url}</a>
        </Fragment>
    )
}

export default DescriptionWithLink;
